import React from 'react';
// import { FaPlay, FaPause } from 'react-icons/fa';

const Track = ({ track, onPlay, isPlaying }) => {
  const { title } = track;

  return (
    <li>
      <div className="trackButton" onClick={onPlay}>
        {isPlaying ? <FaPause /> : <FaPlay />}
      </div>
      <span>{title}</span>
    </li>
  );
};

export default Track;
